import React from 'react';
import {NavLink} from 'react-router-dom';
import {MDBNavLink} from 'mdbreact';
const LogOut = () => {
  return (
    <ul>
      <li>
        <MDBNavLink to='/signup'>Signup</MDBNavLink>
      </li>
      <li>
        <MDBNavLink to='/login'>Log in</MDBNavLink>
      </li>
    </ul>
  );
};

export default LogOut;
